module.exports = [{"name":"XPS15 9560 Clover 安装配置","tags":["hackintosh","黑苹果"],"categories":["MacOS"],"type":"github","url":"https://github.com/jardenliu/XPS15-9560-Mojave/blob/master/README.md","setTop":true,"github":{"owner":"jardenliu","repo":"XPS15-9560-Mojave","branch":"master","path":"README.md"},"updatedDate":"2018-12-31T16:17:26Z","content":"# XPS15-9560-Mojave\n> xps15-9560吃上黑果的clover配置，不方便下载的童鞋可以前往[yeliujun/XPS15-9560-Mojave](https://gitee.com/yeliujun/XPS15-9560-Mojave.git)\n\n## VirtualSmc版本已更新\n* 想更换VirtualSmc，请到[VirtualSmc 分支](https://github.com/jardenliu/XPS15-9560-Mojave/tree/VirtualSmc)下载\n\n## 更新日志\n### 2018-11-09\n- 日常驱动更新`WhateverGreen.kext`、`AppleALC.kext`和`Lilu.kext`\n\n更多详见[changelog.md](https://github.com/jardenliu/XPS15-9560-Mojave/blob/master/changelog.md)\n\n## 配置\n- CPU：Intel I7 7700HQ\n- 内存：16G(8G*2) 2400MHz DDR4\n- 硬盘：东芝 NVMe 512G\n- WIFI网卡：已更换为博通DW1830\n- 屏幕分辨率：4K触控屏\n\n## 特性\n- CPU: I7-7700HQ，已启用原生电源管理；多档变频正常，添加了`CPUFriendDataProvider.kext`,低频可到`800MHZ`，续航表现更好。\n- 声卡: ALC298, 注入ID：72，声音正常。耳机切换采用ALCPluginFix。(Combo jack在Mojave下面似乎失效了)\n- 触摸板: 含触屏，使用`VoodooI2C`,支持Mac原生手势。缺点就是没有防误触\n- WIFI: 原配Killer 1535无法驱动，更换DW1830, 实现免驱。（DW1560应该也可以正常使用）\n- 蓝牙: 驱动正常，极少数情况下会设备丢失，handoff也正常。（没测过1535的蓝牙）\n- ACPI： 使用hotpatch进行热修复，亮度快捷键映射正常。\n- USB: USB3端口均正常使用; TYPE-C 可以热插拔使用；雷电3 不支持热插拔\n- 显卡：集显HD630注入`591B0000`正常驱动；独显GTX 1050无解。\n- 读卡器：无法使用\n\n## 升级教程\n1. 下载仓库配置文件。\n2. 将自己的三码替换到下CLOVER目录下的`config.plist`对应位置。\n3. 把下载的CLOVER替换自己本地的CLOVER文件夹。\n4. 升级完之后，可能会出现以下异常现象，如`亮度不能调节`等。打开`终端`运行`sudo kextcache -i /`命令，重建缓存，重启。\n\n\n## 安装教程\n  实在不想写教程，可以参考小米笔记本pro的安装教程，详见[bilibili小米pro 教程](https://www.bilibili.com/video/av23052183)\n  \n## 小问题处理方式\n#### 1. 字体细、发虚\n  终端执行`defaults write -g CGFontRenderingFontSmoothingDisabled -bool NO`，注销再登录即可\n#### 2. 1080P开启HIDPI\n  使用[xzhih/one-key-hidpi](https://github.com/xzhih/one-key-hidpi)\n#### 3. 安卓USB网络共享\n  把`Post-install`里面的`HoRNDIS.kext`放入`CLOVER/kexts/Other`\n  \n### Wifi蓝牙设置\n1. 关闭wifi唤醒和小憩，`系统偏好设置` -> `节能` 取消两个选项卡中的`小憩`和`唤醒以供Wi-Fi网络访问`的勾选。\n2. 关闭蓝牙唤醒电脑, `系统偏好设置` -> `蓝牙` -> `高级` 取消所有勾选。\n3. ***非DW1830*** 需要替换`Post-install/非DW1830BT/USBPower.kext`到`CLOVER/kexts/Other/`\n4. ***DW1830*** 在windows下设置，设备管理器，右键dw1830（即无线网卡）->属性->高级->Bluetooth Cooperation（前面Bluetooth一致，后边可能不同），设置为disable\n\n\n  \n## 鸣谢\n[RehabMan](https://github.com/RehabMan)、[Acidanthera](https://github.com/acidanthera)、[PMheart](https://github.com/PMheart)、[alexandred](https://github.com/alexandred)、[wmchris](https://github.com/wmchris)、[darkhandz](https://github.com/darkhandz)、[gunslinger23](https://github.com/gunslinger23)、[goodwin](https://github.com/goodwin)等\n\n注：排名不分先后；如有遗漏，请勿见怪，感谢您的付出；\n\n\n"},{"name":"wepy吐司组件：wepy-simple-toast","tags":["小程序"],"categories":["wepy"],"type":"github","url":"https://github.com/jardenliu/wepy-simple-toast/blob/master/README.md","github":{"owner":"jardenliu","repo":"wepy-simple-toast","branch":"master","path":"README.md"},"updatedDate":"2018-07-03T10:36:26Z","content":"# wepy-simple-toast\n微信小程序toast组件，适用于wepy，支持Promise。\n\n## 使用\n**安装组件**\n```bash\n  npm install wepy-simple-toast -S\n```\n**引入组件**\n```javascript\n<template>\n  <view class=\"container\">\n    这里是你的页面内容...\n    <toast/>\n  </view>\n</template>\n\n<script>\nimport wepy from 'wepy'\nimport toast from 'wepy-simple-toast'\n\nexport default class extends wepy.page {\n  components = {\n    toast\n  }\n }\n</script>\n\n```\n**调用方法**\n```javascript\n    // this.$invoke('toast', func, message)\n    this.$invoke('toast', 'success', 'simple-toast success')\n    //或者 this.$invoke('toast', func, message, options)，当前options只有duration（显示的时长）\n    this.$invoke('toast', 'success', 'simple-toast success', { duration: 3000 }).then(data => {\n        console.log(data)\n      })\n\n    // in async function\n   let data = await this.$invoke('toast', 'error', 'simple-toast error', { duration: 5000 })\n    console.log(data)\n```\n1. func 参数包括 `success`、`info`、`warning`、`error`\n2. options参数当前只有 `duration`（显示的时长）\n\n## 使用进阶\n**使用MIXIN**\n```javascript\n  <script>\nimport wepy from 'wepy'\nimport toast from 'wepy-simple-toast'\n\nexport default class extends wepy.page {\n  components = {\n    toast\n  }\n  mixins = [toast.mixin]\n }\n</script>\n```\n\n**调用方法**\n```javascript\n    // this.$infoTip(message)\n    this.$infoTip('simple-toast info')\n    //this.$errorTip(message, options)\n    this.$errorTip('simple-toast error', { duration: 3000 }).then(data => {\n        console.log(data)\n      })\n \n    // in async function\n    let  data = await this.$warningTip('simple-toast warning', { duration: 3000 })\n    console.log(data)\n```\n1. mixin了四个函数 `$successTip`、`$infoTip`、`$warningTip`、`$errorTip`\n2. options参数当前只有 `duration`（显示的时长）\n\n* PS: 如果`components`的名字不为`toast`，使用上述Mixin的四个函数时，需要在data里面添加`toastTagName:[toast的组件名]`\n\n## 完整示例\n点击查看 [example.wpy](https://github.com/jardenliu/wepy-simple-toast/blob/master/example.wpy)\n\n## 效果图\n![example1](https://jardenliu.github.io/demo/wepy-simple-toast/e1.png)\n![example2](https://jardenliu.github.io/demo/wepy-simple-toast/e2.png)\n"}];

